import React, { useState, useEffect } from 'react';
import Card from "../Components/Card/card";
import Button from "../Components/Card/card";
import DefaultLayout from "../Layouts/DefaultLayout";

export default function Home() {
    return (
        <DefaultLayout>
            <div className="ml-auto mr-auto flex flex-col items-center md:justify-center h-screen gap-4 md:gap-6">
                <h1 className="text-sm sm:text-lg text-gray-700 font-medium mt-6 md:mt-0">Welcome, Arianny Mendoza</h1>
                <div id="cards" className="order-2 md:order-1 grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-3">
                    <Card>
                    </Card>
                </div>
                <div className="order-1 md:order-2 flex gap-1 md:gap-4">
                    <Button>

                    </Button>
                    <button type="button" className="w-16 md:w-24 p-1 rounded-2xl text-xs md:text-sm font-medium bg-neutral-50 border border-neutral-300 hover:border-neutral-400 text-neutral-500 hover:text-gray-600">Active</button>
                    <button type="button" className="w-16 md:w-24 p-1 rounded-2xl text-xs md:text-sm font-medium bg-neutral-50 border border-neutral-300 hover:border-neutral-400 text-neutral-500 hover:text-gray-600">Pending</button>
                    <button type="button" className="w-16 md:w-24 p-1 rounded-2xl text-xs md:text-sm font-medium bg-neutral-50 border border-neutral-300 hover:border-neutral-400 focus:border-none focus:bg-green-300 text-neutral-500 hover:text-gray-600">Expired</button>
                </div>
            </div>
        </DefaultLayout>
    );
}
